$(document).ready(function () {
    $("#contactPhone").mask("+#############");
	$('#submitContact').click(function (e) {
		var isValid = true;
		$("#contactForm input").each(function () {
			if ($.trim($(this).val()) == '' || $.trim($(this).val()) == '+') {
				isValid = false;
				$(this).css({
					"border": "1px solid red"
				});
			}
			else {
				$(this).css({
					"border": ""
				});
			}
		});
		if (isValid == false)
			e.preventDefault();
		else {
			var a = $('#contactForm').serialize();
			$.ajax({
				url: 'contact/contact.php', method: 'POST', data: a, success: function (a) {
					if (a == 1) {
						$("#contactResult").html('<div class=\"success\"> Спасибо, ваша заявка принята! </div>').slideDown();
						$('#contactForm').find('input:text').val('')
						$('#contactForm').find('textarea').val('')
					}
				}
			})
			var btn = $('#submitContact');
			btn.css('pointer-events','none');
			setTimeout(function(){
				$(".success").slideUp();
				btn.css('pointer-events','all');
			},5000);
		}
	});
});